const handleErrors = (response) => {
    if(!response.ok){
        return response.statusText
    }   
    return response
}

export default function getDish(url){
    return fetch(url, {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
                'Authorization': `Token 3d8116de8862ea82947004034839d7b87c6eab09`

    },})
        .then(handleErrors)
        .then((res) => {
        try {
            res.json()
        }
        catch {
            console.log(res)
        }
    })
}
